import { useEffect, useState } from 'react';
import { csv } from 'd3';

export const useData = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        csv('/datakuuu.csv') // Adjust the path as necessary
            .then(rawData => {
                const processedData = rawData.map(row => {
                    const coords = row['Location Coordinates']
                        .split(',')
                        .map(coord => +coord.trim())
                        .reverse(); // Ensure coords are [longitude, latitude]
                    return { 
                        Timestamp: new Date(row.Timestamp),
                        HRV: +row.HRV || 0,
                        coords: coords // Directly use coords for the map
                    };
                });

                setData(processedData);
            })
            .catch(error => {
                console.error("Error loading data:", error);
            });
    }, []);

    return data; // Return processed data for use in components
};
